e-8b1c-18d5cc812b0e\"},{\"params\":{\"text\":\"<p>1- Experiment 1 shows that in the presence of both reproductive parts (stamens and pistil) in the flower, pollination takes place and a fruit is formed.</p>\\n\\n<p>2- Experiment 2 shows that in the absence of stamen, no pollination can occur and fruits cannot be formed.</p>\\n\\n<p>3- Experiment 3 shows that, even if the flower has no stamens, if pollen grains (from the same kind of flower) are deposited on the pistil, there is formation of fruit.</p>\\n\\n<p>4- We can conclude that pollen grains are essential in the fruit formation.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"c2b5c4a5-f742-46c8-8429-cd6ad5a25b33\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Click here for the answer.\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Click here for the answer.\"},\"subContentId\":\"80993ad2-6b09-4905-8fda-978322638e16\"}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"metadata\":{\"contentType\":\"Documentation Tool\",\"license\":\"U\",\"title\":\"Untitled Documentation Tool\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Untitled Documentation Tool\"},\"subContentId\":\"fc7a6e25-08d4-45e4-b0e9-5a1191da74b9\"},\"useSeparator\":\"auto\"}]}","library":"H5P.Column 1.13","contentUrl":".","metadata":{"license":"CC BY-NC","title":"I Communicate my knowledge","defaultLanguage":"und","authors":[{"name":"LAL - Tabshoura","role":"Author"}],"licenseVersion":"4.0"},"scripts":["/h5p/libraries/H5P.Text-1.1/scripts/text.js?version=1.1.17","/h5p/libraries/H5P.Image-1.1/image.js?version=1.1.22","/h5p/libraries/H5P.TextInputField-1.2/text-input-field.js?version=1.2.13","/h5p/libraries/H5P.Te
